var body=document.body,id,orphanAge;body.classList.add("has-detached-left");id="";orphanAge="";$(document).on("click","#editAgeModal",function(){id=$(this).data("id");orphanAge=$(this).closest("tr").find("td:eq(1)").text().replace(/\s/g,"");$(".editAge").val(orphanAge);$("#EditOrphanAgeModal").modal("show")});$(".submitStatus").click(function(){if($(".editAge").val()==""){swal({title:"Oops...",text:"Please fill the required field!",confirmButtonColor:"#EF5350",type:"warning"});return}$("#EditOrphanAgeModal").modal("hide");$.ajax({url:"/Settings/EditOrphanAge",data:{id:id,OrphanAge:$(".editAge").val()},type:"GET"}).done(function(){window.location.reload()})});$(document).on("click","#subscribeTeam",function(){var n=$(this).data("id");$.ajax({url:"/Settings/SubscribeTeam/"+n,type:"GET",data:{teamIds:n},success:function(n){swal({title:n,text:"You "+n+" the team successfully",type:"success",confirmButtonColor:"#2196F3"})},error:function(){swal({title:"Oops...",text:"Something went wrong!",confirmButtonColor:"#EF5350",type:"error"})}})});